import React from 'react';
import '../css/app.css';

function Home() {
  return (
    <>
        <div className='top-wrapper'>
            <h1 className='Kijima'>Kijima Riku</h1>
            <h2 className='portforio'>-PORTFORIO-</h2>
        </div>
    </>
  );
}

export default Home;
